import React from "react";
import { Link } from "react-router-dom";
import './Settings.css';
import { Input } from "web3uikit";

const Settings = () => {
  

  return (
    <>
    <div className="pageIdentify">Settings</div>
    <div className="settingsPage">
      <Input 
        label="Name"
        name="NameChange"
        width="100%"
        labelBgColor="#141d26"
      />
      <Input 
        label="Bio"
        name="bioChange"
        width="100%"
        labelBgColor="#141d26"
      />

    </div>
    </>
  );
};

export default Settings;
